import * as React from 'react';

export default () => {
  const [menuModal, setMenuModal] = useState(false);

  const switchMenuModal = () => {
    setMenuModal(!menuModal);
  };
  return (
    <>
      <Header switchMenuModal={switchMenuModal} />
      {menuModal ? (
        <>
          <MenuModal switchMenuModal={switchMenuModal} />
        </>
      ) : null}
    </>
  );
};
